    "pathfinder-national-wildlife-refuge-narrative-report-may-june-july-august-1959",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Pathfinder National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1959.
    The report begins by summarizing the weather conditions, water conditions, habitat
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    and fish- is also covered. A progress report on field investigations and applied
    research is also provided. The public relations section of the report describes
    recreational uses. N-R forms are attached.",nt"license_title": "License Not
